(function($){
  $(document).ready(function() {

    'use strict';

    // =================
    // Responsive layout
    // =================

    // lang_direction is set by wp_localize_script
    // In order for the masonry layout to be RTL, we need to set the isOriginLeft value to be false
    // that's why we set the lang_direction and then change the is_ltr variable based on it's value
    var is_ltr = true;
    if (lang_direction.rtl) {
      is_ltr = false;
    }

    // Init Masonry
    var $masonry_grid = $('.js-grid').masonry({
      itemSelector: '.js-grid__col',
      percentPosition: true,
      isOriginLeft: is_ltr
    });

    // Layout Masonry after each image loads
    $masonry_grid.imagesLoaded().progress(function() {
      $masonry_grid.masonry('layout');
    });

    // ========================
    // Post Card Images Fade
    // ========================

    $('.js-fadein').viewportChecker({
      classToAdd: 'is-inview', // Class to add to the elements when they are visible
      offset: 100,
      removeClassAfterAnimation: true
    });

    // =================
    // Responsive videos
    // =================

    $('.c-content').fitVids();

    // ===============
    // Off Canvas menu
    // ===============

    $('.js-off-canvas-toggle').click(function(e) {
      e.preventDefault();
      $('.js-off-canvas-container').toggleClass('is-active');
    });

    // ======
    // Search
    // ======

    var search_field = $('.js-search-input'),
        toggle_search = $('.js-search-toggle');

    toggle_search.click(function(e) {
      e.preventDefault();
      $('.js-search').addClass('is-active');

      // If off-canvas is active, just disable it
      $('.js-off-canvas-container').removeClass('is-active');

      setTimeout(function() {
        search_field.focus();
      }, 500);
    });


  });
})(jQuery);
jQuery('.c-search, .js-search-close').on('click keyup', function(event) {
  if (event.target == this ||  event.target.className.indexOf('js-search-close') > -1 || event.keyCode == 27) {
    jQuery('.c-search').removeClass('is-active');
  }
});
